define("tooltip/structure.css", ["curl/plugin/style", "require"], function (injector, require) { var text = "
#tooltip-viz rect {
  fill: #526F75;
  shape-rendering: crispEdges;
}

#tooltip-viz rect:hover {
  fill: #94B4BF;
}

.d3-tip {
  padding: 5px;
  background-color: rgba(250, 250, 250, 0.9);
}

#tooltip-viz .y.axis line, #tooltip-viz .y.axis path, #tooltip-viz .x.axis line {
  fill: none;
  stroke: #555;
}

#tooltip-viz text {
  fill: #555;
}"; if (0) text = injector.translateUrls(text, require.toUrl("")); return text; });
define("curl/plugin/css!tooltip/structure.css", ["curl/plugin/style!tooltip/structure.css"], function (sheet) { return sheet; });
